import React from "react";
import { Link } from "react-router-dom";

function Footer() {
  return (
    <div>
      <div className="card bg-dark text-white">
        <div className="card-body nav justify-content-center">
          <p className="card-text">
            For further supporting ifo about movies arround the world and
            getting the premium access to the movie world you can make a little
            pressure on button you see bellow
          </p>
        </div>
        <div>
          <Link to="https://www.imdb.com" target="_blank">
            <button className=" text-primary btn-warning">Button</button>
          </Link>
        </div>
      </div>
    </div>
  );
}

export default Footer;
